const link = "https://firebasestorage.googleapis.com/v0/b/shop-7951b.appspot.com/o/products_images%2F"
const getlink = (myLink) => {
    const link = "https://firebasestorage.googleapis.com/v0/b/shop-7951b.appspot.com/o/products_images%2F"
    return toString(link+myLink)

}
const initialState = {
    products : {
        accessories : {
            men: [{
                itemID: "1",
                name: "chain",
                mainFoto: getlink(),

            }],
            woman : [],
            kids: [],
        },
        bags : {
            men: [],
            woman : [],
            kids: [],
        },
        denim : {
            men: [],
            woman : [],
            kids: [],
        },
        "t-shirts" : {
            men: [],
            woman : [],
            kids: [],
        }
    }


}
export const productsReducer = (state = initialState, action) => {
    switch (action.type) {
        default:
            return state
    }
}
